<title>Profile</title>
<meta charset="utf-8">
<link rel="stylesheet" href="css/normalize.min.css">
<link rel="stylesheet" href="css/d3-stack-graph.css">
<link rel="stylesheet" href="css/profile.css">
<link rel="stylesheet" href="css/tablesort.css">
<script src="js/d3.min.js" type="text/javascript"></script>
<script src="js/d3fc-discontinuous-scale.js" type="text/javascript"></script>
<script src="js/data.js" type="text/javascript"></script>
<script src="js/analysis.js" type="text/javascript"></script>
<script src="js/profile.js" type="text/javascript"></script>
<script src="js/d3-stack-graph.js" type="text/javascript"></script>
<script src="js/tablesort.js" type="text/javascript"></script>
<script src="js/tooltip.js" type="text/javascript"></script>
<script src="report_data.js" type="text/javascript"></script>
<div id="header">
Profile for <span id="profile-source">unknown</span> generated <span id="profile-time">unknown</span>
<div id="progress"><img src="css/spinner.gif"></div>
</div>
<div id="content">
<div id="stackgraph"></div>
<div id="calls">
    <div id="calltable-config">
        <label><input type="checkbox" id="calltable-aggregate" /> Aggregate <span class="help" data-title="Group all calls to the same function (including caller context if selected) into one row">?</span></label><!--
        --><label>Caller Context: <input type="range" id="calltable-context" min="0" max="4" step="1" value="0" /> <span id="calltable-context-n">0</span> <span class="help" data-title="How many of a function's ancestors to include in the function call row">?</span></label><!--
        --><label><input type="checkbox" id="calltable-collapse-solver" /> Collapse solver time <span class="help" data-title="Remove all solver time from the profile">?</span></label><!--
        --><label><input type="checkbox" id="calltable-signature" /> Signatures <span class="help" data-title="Show the types of the inputs and outputs of each call (either Concrete, Symbolic, or Union)">?</span></label><!--
        --><label><input type="checkbox" id="calltable-callsites" /> Show Callsites <span class="help" data-title="Show where each call was made from">?</span></label><!--
        --><a href="" id="calltable-config-toggle-more">[More]</a>
        <div id="calltable-config-more">
            <label><input type="checkbox" id="calltable-prune" /> Filter Unimportant Calls <span class="help" data-title="Hide all calls with a very small score">?</span></label><!--
            --><label><input type="checkbox" id="calltable-collapse-rosette" /> Collapse lifted Rosette calls <span class="help" data-title="Fold calls to Rosette functions into their callers">?</span></label><!--
            --><label><input type="checkbox" id="calltable-show-scoreboxes" /> Show score controls <span class="help" data-title="Show options to control score computation">?</span></label>
        </div>
    </div>
    <table id="calltable">
        <thead></thead>
        <tbody></tbody>
    </table>
</div>
</div>
